// Contenido del popup para cada feature
function popupContentNAF(feature) {
    return (
        "<div id='Estilo1'><h3>Descripción</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='1' width='100%' />" +
        "<div id='Estilo3a'>" +
        "<b> Provincia : </b>" + feature.properties.provincia + "<br>" +
        "<b> Departamento : </b>" + feature.properties.departamen + "<br>" +
"<b> Total de Pob. con NAF : </b>" + feature.properties.total_NAF + "<br>" +
"<b> Total Pob. Provicial con NAF : </b>" + feature.properties.suma_NAF + "<br>" +
"<b> Fuente : </b> Elaborado a partir de Atlas de Agricultura Familiar" + "<br>" +
"<b> Fecha : </b>" + feature.properties.fecha_crea + "<br>" +
        "</div>"
    );
}
function getColorNAF(total_NAF) {
    {
        if (total_NAF >= 1 && total_NAF <= 400) return "#ffffd4";
        if (total_NAF > 401 && total_NAF <= 800) return "#fee391";
        if (total_NAF > 801 && total_NAF <= 1800) return "#fec44f";
        if (total_NAF > 1801 && total_NAF <= 2800) return "#fe9929";
        if (total_NAF > 2801 && total_NAF <= 3800) return "#d95f0e";
        if (total_NAF > 3801 ) return "#993404";
    }
};

function styleNAG(feature) {
    return {
        fillColor: getColorNAF(feature.properties.total_NAF),
        weight: 1,
        opacity: 0.9,
        color: '#292828',
        dashArray: '0',
        fillOpacity: 0.9,
        stroke: '#232323',
    }
}

// Función para generar la leyenda
function createLegendNAF() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];

        var styles = [
            { label: 'Total pob. NAF', color: '' },
            { label: '1 - 400', color: '#ffffd4' },
            { label: '401 - 800', color: '#fee391' },
            { label: '801 - 1800', color: '#fec44f' },
            { label: '1801 - 2800', color: '#fe9929' },
            { label: '2801 - 3800', color: '#d95f0e' },
            { label: '3800 - 5500', color: '#993404' },
            // Agrega aquí el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(NucleosAF)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}